import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Outlet } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { PermissionsProvider } from './contexts/PermissionsContext';
import { NotificationProvider } from './contexts/NotificationContext';
import MainLayout from './components/layout/MainLayout';
import Login from './pages/auth/Login';
import Dashboard from './pages/Dashboard';
import Applications from './pages/Applications';
import ApplicationForm from './pages/ApplicationForm';
import ApplicationDetail from './pages/ApplicationDetail';
import Clients from './pages/Clients';
import ClientDetail from './pages/ClientDetail';
import ClientForm from './pages/ClientForm';
import Messages from './pages/Messages';
import Reports from './pages/Reports';
import Settings from './pages/Settings';
import ProtectedRoute from './components/auth/ProtectedRoute';
import NotFound from './pages/NotFound';
import AppShell from './components/ui/AppShell';

// Create stub components for missing pages
const Companies = () => <div>Companies Page</div>;
const CompanyDetail = () => <div>Company Detail Page</div>;
const KanbanView = () => <div>Kanban View Page</div>;

const App: React.FC = () => {
  // Add event listener to track if user has interacted with the page
  // This helps with browser autoplay restrictions
  useEffect(() => {
    const markUserInteraction = () => {
      document.documentElement.setAttribute('data-user-interacted', 'true');
    };

    // Listen for common user interaction events
    const events = ['click', 'keydown', 'mousedown', 'touchstart'];
    events.forEach(event => {
      document.addEventListener(event, markUserInteraction, { once: true });
    });

    // Clean up event listeners
    return () => {
      events.forEach(event => {
        document.removeEventListener(event, markUserInteraction);
      });
    };
  }, []);

  return (
      <Router>
        <AuthProvider>
          <PermissionsProvider>
            <NotificationProvider>
            <AppShell>
              <Routes>
                <Route path="/login" element={<Login />} />

                <Route
                  path="/" 
                  element={
                    <ProtectedRoute>
                      <MainLayout>
                        <Outlet />
                      </MainLayout>
                    </ProtectedRoute>
                  }
                >
                  <Route index element={<Navigate to="/dashboard" replace />} />
                  <Route path="dashboard" element={<Dashboard />} />

                  <Route path="applications">
                    <Route index element={<Applications />} />
                    <Route path="new" element={<ApplicationForm />} />
                    <Route path="edit/:id" element={<ApplicationForm />} />
                    <Route path=":id" element={<ApplicationDetail />} />
                    <Route path="kanban" element={<KanbanView />} />
                  </Route>

                  <Route path="companies">
                    <Route index element={<Companies />} />
                    <Route path=":id" element={<CompanyDetail />} />
                  </Route>

                  <Route path="clients">
                    <Route index element={<Clients />} />
                    <Route path="new" element={<ClientForm />} />
                    <Route path="edit/:id" element={<ClientForm />} />
                    <Route path=":id" element={<ClientDetail />} />
                  </Route>

                  <Route path="messages" element={<Messages />} />
                  <Route path="reports" element={<Reports />} />
                  <Route path="settings" element={<Settings />} />
                </Route>

                <Route path="*" element={<NotFound />} />
              </Routes>
            </AppShell>
            </NotificationProvider>
          </PermissionsProvider>
        </AuthProvider>
      </Router>
  );
};

export default App;
